import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:stacked_services/stacked_services.dart';
import 'package:url_launcher/url_launcher.dart';

import 'config.dart';

class Utils {

  ///
  /// Provide current context from anywhere
  ///
  static BuildContext getContext() {
    return StackedService.navigatorKey!.currentState!.overlay!.context;
  }

  ///
  /// Convert Hex Color to Int Color
  ///
  static int getColorFromHex(String hexColor) {
    hexColor = hexColor.toUpperCase().replaceAll("#", "");
    if (hexColor.length == 6) {
      hexColor = "FF" + hexColor;
    }
    return int.parse(hexColor, radix: 16);
  }

  ///
  /// Convert Hex Color to Int Color
  ///
  static String getUrl( SdkData sdkData) {
    final base64 = sdkData.toBase64();
    return '$KKiaPayURL/?$base64';
  }


  static Future<void> launchWave(String url) async {
    try{
      final Uri _uri = Uri.parse(url);
      await launchUrl(_uri);
    }catch(e){
      final Uri _uri = Uri.parse(WaveStoreRedirectURI);
      if(await launchUrl(_uri)){
        throw 'Could not launch $WaveStoreRedirectURI';
      }
    }
  }

}

Image imageFromBase64String() {
  return Image.memory(base64Decode(loaderBase64));
}

String loaderBase64 = '';